  true,\n\t\"url\": null,\n\t\"notes\": \"The Federal Perkins Loan Cohort Default
  Rates 2012 (Federal Perkins Loan CDR 2012), is a data collection that is part of
  the Federal Perkins Loan program; program data is available electronically since
  2006 at <http://ifap.ed.gov/ifap/byAwardYear.jsp?type=perkinscdrguide&set=archive&display=single>.
  Federal Perkins Loan CDR 2012 (http://ifap.ed.gov/ifap/per_co_defrates.jsp) is a
  cross-sectional data collection that queries the universe of postsecondary institutions
  about their Federal Perkins Loan default rates. The data collection is conducted
  using a web-based entry system wherein postsecondary institutions must submit information
  electronically if they participate in the Federal Perkins Loan program. Key statistics
  produced from this data collection are the Federal Perkins Loan cohort default rates
  (previously known as the Orange Book).\",\n\t\"license_title\": \"Creative Commons
